import React, { useEffect } from 'react';

const Time = () => {
  useEffect(() => {
    const loadTypedScript = async () => {
      // Create a script element
      const script = document.createElement('script');
      script.src = 'https://cdn.jsdelivr.net/npm/typed.js@2.1.0';
      script.async = true;

      // Promisify script loading
      const loadScript = () => new Promise((resolve, reject) => {
        script.onload = resolve;
        script.onerror = reject;
      });

      // Append the script to the head and wait for it to load
      document.head.appendChild(script);
      await loadScript();

      // Setup and start animation after the script has loaded
      new window.Typed('#element', {
        strings: ['<i>First</i> sentence.', '&amp; a second sentence.'],
        typeSpeed: 50,
      });
    };

    // Load Typed.js script
    loadTypedScript();

    return () => {
      // Cleanup function to remove the script tag when the component unmounts
      document.getElementById('element').innerHTML = ''; // Clear the content
    };
  }, []);

  return (
    <div>
      {/* Element to contain animated typing */}
      <span id="element"></span>
    </div>
  );
};

export default Time;
